import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { TEChart } from "tw-elements-react";

const Graph = () => {
  const [data, setData] = useState([]);

  const fetchData = async () => {
    try {
      const response = await axios.get("http://localhost:3001/api/graph");
      setData(response.data);
    } catch (error) {
      console.log(error, "data fetching error");
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className='bg-white graph ml-20 rounded-l-lg rounded-r-lg w-1/4 h-2/4'>
      <TEChart
        type="line"
        data={{
          labels: data?.map(item => item?.x),
          datasets: [
            {
              label: "Traffic",
              data: data?.map(item => item?.y),
            },
          ],
        }}
        options={{
          // Adjust the height here
          // For example, setting the height to 300 pixels
        }}
      />
    </div>
  );
}

export default Graph;
